import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { Box } from "@mui/material";
import { ThemeProvider } from "@mui/material/styles";
// import Navbar from './components/Navbar';
import theme from "./theme";
import Landing from "./components/universal/Landing";

function App() {
  return (
    <ThemeProvider theme={theme}>
      <Box sx={{ backgroundColor: theme.palette.background.default, display: "flex", flexDirection: "column", height: "100vh" }}>
        <Router>
          {/* <Navbar /> */}
          <Box
            flex="1"
            display="flex"
            justifyContent="center"
            alignItems="center"
            height="92vh"
            width="100vw"
          >
            <Routes>
              <Route exact path="/" element={<Landing/>} />
              <Route path="/about">
                {/* Your component for the about page */}
              </Route>
              <Route path="/contact">
                {/* Your component for the contact page */}
              </Route>
            </Routes>
          </Box>
        </Router>
      </Box>
    </ThemeProvider>
  );
}

export default App;
